import{_ as a,c as r,a3 as t,o}from"./chunks/framework.BqUCYBlT.js";const u=JSON.parse('{"title":"Github加速","description":"","frontmatter":{},"headers":[],"relativePath":"projects/gh-proxy.md","filePath":"projects/gh-proxy.md","lastUpdated":1730490201000}'),h={name:"projects/gh-proxy.md"};function n(s,e,p,l,i,c){return o(),r("div",null,e[0]||(e[0]=[t(`<h1 id="github加速" tabindex="-1">Github加速 <a class="header-anchor" href="#github加速" aria-label="Permalink to &quot;Github加速&quot;">​</a></h1><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>github release、archive以及项目文件的加速项目，支持clone，有Cloudflare Workers无服务器版本以及Python版本</p><h2 id="演示" tabindex="-1">演示 <a class="header-anchor" href="#演示" aria-label="Permalink to &quot;演示&quot;">​</a></h2><p><a href="https://github.lincdn.com/" target="_blank" rel="noreferrer">Github加速 - 演示</a></p><p>演示站为公共服务，如有大规模使用需求请自行部署，演示站有点不堪重负</p><p><img src="https://images.lincdn.com/202411/02/ws-HC31tC1VGS.png" alt="1730488391593.png"></p><p>当然也欢迎<a href="#捐赠">捐赠</a>以支持作者</p><h2 id="python版本和cf-worker版本差异" tabindex="-1">python版本和cf worker版本差异 <a class="header-anchor" href="#python版本和cf-worker版本差异" aria-label="Permalink to &quot;python版本和cf worker版本差异&quot;">​</a></h2><ul><li><p>python版本支持进行文件大小限制，超过设定返回原地址 <a href="https://github.com/hunshcn/gh-proxy/issues/8" target="_blank" rel="noreferrer">issue #8</a></p></li><li><p>python版本支持特定user/repo 封禁/白名单 以及passby <a href="https://github.com/hunshcn/gh-proxy/issues/41" target="_blank" rel="noreferrer">issue #41</a></p></li></ul><h2 id="使用" tabindex="-1">使用 <a class="header-anchor" href="#使用" aria-label="Permalink to &quot;使用&quot;">​</a></h2><p>直接在copy出来的url前加<code>https://github.lincdn.com/</code>即可</p><p>也可以直接访问，在input输入</p><p><em><strong>大量使用请自行部署，以上域名仅为演示使用。</strong></em></p><p>访问私有仓库可以通过</p><p><code>git clone https://user:TOKEN@ghproxy.com/https://github.com/xxxx/xxxx</code> <a href="https://github.com/hunshcn/gh-proxy/issues/71" target="_blank" rel="noreferrer">#71</a></p><p>以下都是合法输入（仅示例，文件不存在）：</p><ul><li><p>分支源码：<a href="https://github.com/hunshcn/project/archive/master.zip" target="_blank" rel="noreferrer">https://github.com/hunshcn/project/archive/master.zip</a></p></li><li><p>release源码：<a href="https://github.com/hunshcn/project/archive/v0.1.0.tar.gz" target="_blank" rel="noreferrer">https://github.com/hunshcn/project/archive/v0.1.0.tar.gz</a></p></li><li><p>release文件：<a href="https://github.com/hunshcn/project/releases/download/v0.1.0/example.zip" target="_blank" rel="noreferrer">https://github.com/hunshcn/project/releases/download/v0.1.0/example.zip</a></p></li><li><p>分支文件：<a href="https://github.com/hunshcn/project/blob/master/filename" target="_blank" rel="noreferrer">https://github.com/hunshcn/project/blob/master/filename</a></p></li><li><p>commit文件：<a href="https://github.com/hunshcn/project/blob/1111111111111111111111111111/filename" target="_blank" rel="noreferrer">https://github.com/hunshcn/project/blob/1111111111111111111111111111/filename</a></p></li><li><p>gist：<a href="https://gist.githubusercontent.com/cielpy/351557e6e465c12986419ac5a4dd2568/raw/cmd.py" target="_blank" rel="noreferrer">https://gist.githubusercontent.com/cielpy/351557e6e465c12986419ac5a4dd2568/raw/cmd.py</a></p></li></ul><h2 id="cf-worker版本部署" tabindex="-1">cf worker版本部署 <a class="header-anchor" href="#cf-worker版本部署" aria-label="Permalink to &quot;cf worker版本部署&quot;">​</a></h2><p>首页：<a href="https://workers.cloudflare.com" target="_blank" rel="noreferrer">https://workers.cloudflare.com</a></p><p>注册，登陆，<code>Start building</code>，取一个子域名，<code>Create a Worker</code>。</p><p>复制 <a href="https://cdn.jsdelivr.net/gh/hunshcn/gh-proxy@master/index.js" target="_blank" rel="noreferrer">index.js</a> 到左侧代码框，<code>Save and deploy</code>。如果正常，右侧应显示首页。</p><p><code>ASSET_URL</code>是静态资源的url（实际上就是现在显示出来的那个输入框单页面）</p><p><code>PREFIX</code>是前缀，默认（根路径情况为&quot;/&quot;），如果自定义路由为example.com/gh/*，请将PREFIX改为 &#39;/gh/&#39;，注意，少一个杠都会错！</p><h2 id="python版本部署" tabindex="-1">Python版本部署 <a class="header-anchor" href="#python版本部署" aria-label="Permalink to &quot;Python版本部署&quot;">​</a></h2><h3 id="docker部署" tabindex="-1">Docker部署 <a class="header-anchor" href="#docker部署" aria-label="Permalink to &quot;Docker部署&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>docker run -d --name=&quot;gh-proxy-py&quot; \\</span></span>
<span class="line"><span>  -p 0.0.0.0:80:80 \\</span></span>
<span class="line"><span>  --restart=always \\</span></span>
<span class="line"><span>  hunsh/gh-proxy-py:latest</span></span></code></pre></div><p>第一个80是你要暴露出去的端口</p><h3 id="直接部署" tabindex="-1">直接部署 <a class="header-anchor" href="#直接部署" aria-label="Permalink to &quot;直接部署&quot;">​</a></h3><p>安装依赖（请使用python3）</p><p><code>pip install flask requests</code></p><p>按需求修改<code>app/main.py</code>的前几项配置</p><p><em>注意:</em> 可能需要在<code>return Response</code>前加两行</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>if &#39;Transfer-Encoding&#39; in headers:</span></span>
<span class="line"><span>    headers.pop(&#39;Transfer-Encoding&#39;)</span></span></code></pre></div><h3 id="注意" tabindex="-1">注意 <a class="header-anchor" href="#注意" aria-label="Permalink to &quot;注意&quot;">​</a></h3><p>python版本的机器如果无法正常访问github.io会启动报错，请自行修改静态文件url</p><p>python版本默认走服务器（2021.3.27更新）</p><h2 id="cloudflare-workers计费" tabindex="-1">Cloudflare Workers计费 <a class="header-anchor" href="#cloudflare-workers计费" aria-label="Permalink to &quot;Cloudflare Workers计费&quot;">​</a></h2><p>到 <code>overview</code> 页面可参看使用情况。免费版每天有 10 万次免费请求，并且有每分钟1000次请求的限制。</p><p>如果不够用，可升级到 $5 的高级版本，每月可用 1000 万次请求（超出部分 $0.5/百万次请求）。</p><h2 id="changelog" tabindex="-1">Changelog <a class="header-anchor" href="#changelog" aria-label="Permalink to &quot;Changelog&quot;">​</a></h2><ul><li>2020.04.10 增加对<code>raw.githubusercontent.com</code>文件的支持</li><li>2020.04.09 增加Python版本（使用Flask）</li><li>2020.03.23 新增了clone的支持</li><li>2020.03.22 初始版本</li></ul><h2 id="链接" tabindex="-1">链接 <a class="header-anchor" href="#链接" aria-label="Permalink to &quot;链接&quot;">​</a></h2><p><a href="https://hunsh.net" target="_blank" rel="noreferrer">我的博客</a></p><h2 id="参考" tabindex="-1">参考 <a class="header-anchor" href="#参考" aria-label="Permalink to &quot;参考&quot;">​</a></h2><p><a href="https://github.com/EtherDream/jsproxy/" target="_blank" rel="noreferrer">jsproxy</a></p><h2 id="捐赠" tabindex="-1">捐赠 <a class="header-anchor" href="#捐赠" aria-label="Permalink to &quot;捐赠&quot;">​</a></h2><p><img src="https://img.maocdn.cn/img/2021/04/24/image.md.png" alt="wx.png"><img src="https://www.helloimg.com/images/2021/04/24/BK9vmb.md.png" alt="ali.png"></p><h2 id="仓库" tabindex="-1">仓库 <a class="header-anchor" href="#仓库" aria-label="Permalink to &quot;仓库&quot;">​</a></h2><p><a href="https://github.com/hunshcn/gh-proxy" target="_blank" rel="noreferrer">https://github.com/hunshcn/gh-proxy</a></p>`,50)]))}const g=a(h,[["render",n]]);export{u as __pageData,g as default};
